    MDBNavbarNav,
    MDBNavbarItem,
    MDBNavbarLink,
    MDBNavbarToggler,
    MDBContainer,
    MDBIcon } from 'mdb-react-ui-kit';


import styles from './mystyle.module.css'; 
const Header = () => {
    return(
            <header>
                <MDBNavbar expand="lg" light bgColort="white">
                    <MDBContainer fluid>
                        <MDBNavbarToggler
                            aria-controls="navbarExample01"
                            aria-expanded="false"
                            aria-label="Toggle navigation">
                                <MDBIcon fas icon="bars"/>
                            </MDBNavbarToggler>
                    </MDBContainer>
                </MDBNavbar>
            </header>



    
